USE Camada29635
DECLARE @n CHAR(1)
SET @n = CHAR(10)
DECLARE @stmt NVARCHAR(max)
-- procedures
SELECT @stmt = isnull(@stmt + @n, '') + 'drop procedure [' + schema_name(schema_id) + '].[' + name + ']'
FROM sys.procedures
-- check constraints
SELECT @stmt = isnull(@stmt + @n, '') + 'alter table [' + schema_name(schema_id) + '].[' + object_name(parent_object_id) + ']    drop constraint [' + name + ']'
FROM sys.check_constraints
-- functions
SELECT @stmt = isnull(@stmt + @n, '') + 'drop function [' + schema_name(schema_id) + '].[' + name + ']'
FROM sys.objects
WHERE type IN ('FN', 'IF', 'TF')
-- views
SELECT @stmt = isnull(@stmt + @n, '') + 'drop view [' + schema_name(schema_id) + '].[' + name + ']'
FROM sys.VIEWS
-- foreign keys
SELECT @stmt = isnull(@stmt + @n, '') + 'alter table [' + schema_name(schema_id) + '].[' + object_name(parent_object_id) + '] drop constraint [' + name + ']'
FROM sys.foreign_keys
-- tables
SELECT @stmt = isnull(@stmt + @n, '') + 'drop table [' + schema_name(schema_id) + '].[' + name + ']'
FROM sys.tables
-- user defined types
SELECT @stmt = isnull(@stmt + @n, '') + 'drop type [' + schema_name(schema_id) + '].[' + name + ']'
FROM sys.types
WHERE is_user_defined = 1
EXEC sp_executesql @stmt
GO
CREATE TABLE REGION(
	IDREGION						INT									NOT NULL,
	DETALLE							NVARCHAR(MAX)						NOT NULL,
	CONSTRAINT [PK_REGION] PRIMARY KEY CLUSTERED 
([IDREGION] ASC) WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]) ON [PRIMARY]

CREATE TABLE COMUNA(                                                    
	IDCOMUNA						INT									NOT NULL,
