ALTER TABLE COMUNA
ADD CONSTRAINT FK_COMUNA_REGION
FOREIGN KEY (IDREGION)
REFERENCES REGION(IDREGION)

ALTER TABLE VENTA
ADD CONSTRAINT FK_VENTA_COMUNA
FOREIGN KEY (IDCOMUNA)
REFERENCES COMUNA(IDCOMUNA)

ALTER TABLE VENTAITEM
ADD CONSTRAINT FK_VENTAITEM_VENTA
FOREIGN KEY (IDVENTA)
REFERENCES VENTA(IDVENTA)

ALTER TABLE VENTAITEM
